  const {
      video
  } = props;

  return (
      <Container className="gird-item">
        <div className="thum">
            <img src={video.snippet.thumbnails.default.url} alt=""/>
        </div>
          <div className="desc">
              <h3>{video.snippet.title}</h3>
          </div>
      </Container>
  )

}

const Container = styled.div`

`;

export default YoutubeVideo;
